#define SRC_WIDTH  8
#define SRC_HEIGHT 8
#define DEST_WIDTH 120
#define DEST_HEIGHT 120
#define SCALE_FACTOR 15  // 120/8

// Function to scale 8x8 image to 56*56
void scaleImage(uint8_t *src, uint8_t *dest) {
    for (int y = 0; y < SRC_HEIGHT; y++) {
        for (int x = 0; x < SRC_WIDTH; x++) {
            uint8_t pixel = src[y * SRC_WIDTH + x];  // Get original pixel

            // Expand this pixel into SCALE_FACTOR x SCALE_FACTOR block
            for (int dy = 0; dy < SCALE_FACTOR; dy++) {
                for (int dx = 0; dx < SCALE_FACTOR; dx++) {
                    int destX = x * SCALE_FACTOR + dx;
                    int destY = y * SCALE_FACTOR + dy;
                    dest[destY * DEST_WIDTH + destX] = pixel;
                }
            }
        }
    }
}

#define SRC_WIDTH  8
#define SRC_HEIGHT 4
#define DEST_WIDTH 120
#define DEST_HEIGHT 120
#define SCALE_X 15  // Width scaling factor
#define SCALE_Y 30  // Height scaling factor
#define BYTES_PER_PIXEL 2  // 2 bytes per pixel (RGB565 format)

void scaleImage_120x120(uint16_t *src, uint16_t *dest) {
    for (int y = 0; y < SRC_HEIGHT; y++) {
        for (int x = 0; x < SRC_WIDTH; x++) {
            uint16_t pixel = src[y * SRC_WIDTH + x];  // Get 2-byte pixel from source

            // Expand this pixel into SCALE_X x SCALE_Y block
            for (int dy = 0; dy < SCALE_Y; dy++) {
                for (int dx = 0; dx < SCALE_X; dx++) {
                    int destX = x * SCALE_X + dx;
                    int destY = y * SCALE_Y + dy;
                    dest[destY * DEST_WIDTH + destX] = pixel;
                }
            }
        }
    }
}


#define SRC_WIDTH4  4
#define SRC_HEIGHT4 4
#define SCALE_FACTOR_4 30
void scaleImage4x4(uint8_t *src, uint8_t *dest) {
    for (int y = 0; y < SRC_HEIGHT4; y++) {
        for (int x = 0; x < SRC_WIDTH4; x++) {
            uint8_t pixel = src[y * SRC_WIDTH4 + x];  // Get original pixel

            // Expand this pixel into SCALE_FACTOR x SCALE_FACTOR block
            for (int dy = 0; dy < 15; dy++) {
                for (int dx = 0; dx < 15; dx++) {
                    int destX = x * 15 + dx;
                    int destY = y * 15 + dy;
                    dest[destY * DEST_WIDTH + destX] = pixel;
                }
            }
        }
    }
}


